import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Cards";
import "./index.css";
import Series from "./Series";
// console.log(Series[0].sname)

ReactDOM.render(
  <>
  <h1 className='heading_style'>List of Top 5 series in Netflix</h1>
    <Card 
      imgsrc={Series[0].imgsrc}
      title={Series[0].title}
      sname={Series[0].imgsrc}
      link={Series[0].imgsrc}
    />
    <Card imgsrc="https://wallpapercave.com/wp/wp1935778.jpg"
      title="A Netflix Original Series "
      sname="13 REASONS WHY?"
      link="https://www.netflix.com/in/title/80990668?source-35" 

      />
    <Card imgsrc="https://wallpapercave.com/wp/wp5174993.jpg"
      title="A Netflix Original Series "
      sname="MASAAN"
      link="https://www.netflix.com/in/title/80990668?source-35"

      />
  </>,
  document.getElementById('root'));
